import { Component } from '@angular/core';
import { Router } from '@angular/router';
import Swal from 'sweetalert2';
import { Customer } from 'src/models/Customer';

@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {


  public totalItem : number = 0;
  public searchTerm !: string;

  // currentGame: string ="";
  constructor(private router:Router ) { 
    // this.currentGame = JSON.parse(localStorage.getItem('currentGame')); 
  }

  ngOnInit(): void {

  }



logIn(){
  if(localStorage.getItem('email')){
    this.router.navigateByUrl('/home'),

    Swal.fire({
      icon: 'error',
      title: 'Oops...',
      text: 'First LogOut then LogIn agin!',

    })

  }else{
    Swal.fire({
      position: 'top',
      icon: 'success',
      title: 'Redirected To login page',
      showConfirmButton: false,
      timer: 1500
    })
  }
}


  logOut(){

    Swal.fire({
      title: 'Are you sure?',
      text: "You won't be able to revert this!",
      icon: 'warning',
      showCancelButton: true,
      confirmButtonColor: '#3085d6',
      cancelButtonColor: '#d33',
      confirmButtonText: 'Yes, LogOut!'
    }).then((result) => {
      if (result.isConfirmed) {
        Swal.fire(
          'LogOut!',
          'Your are Logout...',
          'success'
        ),
        localStorage.removeItem('email'),
          this.router.navigateByUrl('/login'),
          console.log("Log Out Success")
      }
    })
  }


}
<nav class="navbar navbar-expand-lg navbar-light bg-light">
  <div class="container-fluid" style="height: 100px">
    <a class="navbar-brand" routerLink="/home"
      ><span id="logo">
        <img src="assets\image\cutlery.gif" alt="" width="70px" /><strong
          >Mini Loan App</strong
        ></span
      >
    </a>
    <button
      class="navbar-toggler"
      type="button"
      data-bs-toggle="collapse"
      data-bs-target="#navbarNav"
      aria-controls="navbarNav"
      aria-expanded="true"
      aria-label="Toggle navigation"
    >
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse bg-light" id="navbarNav">
      <ul class="navbar-nav ms-auto">
        <li class="nav-item">
          <button
            class="btn btn-outline-dark"
            style="
              margin-right: 25px;
              margin-top: 5px;
              height: 65px;
              width: 65px;
            "
            mat-flat-button
            routerLink="/home"
            routerLinkActive="active-link"
          >
            <img src="assets\images\home.gif" alt="" width="55px" />
          </button>
        </li>

        <li>
          <button
            (click)="logOut()"
            class="btn btn-outline-dark"
            style="
              margin-right: 25px;
              margin-top: 6px;
              height: 65px;
              width: 65px;
            "
            mat-flat-button
          >
            <img src="assets\images\login.gif" alt="" width="55px" />
            <!-- <mat-icon>login</mat-icon>
                Login -->
          </button>
        </li>

        <li>
          <span id="cart">
            <button
              class="btn btn-outline-dark"
              routerLink="/loanStatus"
              style="margin-top: 6px; height: 65px; width: 65px"
              mat-flat-button
              class="btn btn-outline-dark"
            >
              <img src="assets\images\money.gif" alt="" width="60px" />
            </button>
          </span>
        </li>

        <li></li>
      </ul>
    </div>
  </div>
</nav>
